import React from 'react';
import ReactDOM from 'react-dom/client';
import './index.css';
import App from './App';
import reportWebVitals from './reportWebVitals';

type WeatherListItemMain = {
  feels_like : number;
  grnd_level : number;
  humidity : number;
  pressure : number;
  sea_level : number;
  temp : number;
  temp_kf : number;
  temp_max : number;
  temp_min : number;
}

type WeatherListItemWeather = {
  description : string;
  icon : string;
  id : number;
  main : string;
}

type WeatherListItem = {
  dt : number;
  main : WeatherListItemMain;
  weather : Array<WeatherListItemWeather>;
}

type WeatherData = {
  day: string;
  temp : number;
  weatherDesc : string;
  weatherIcon : string;
}

const root = ReactDOM.createRoot(
  document.getElementById('root') as HTMLElement
);
root.render(
  <React.StrictMode>
    <App />
  </React.StrictMode>
);

